from typing import List


###
# 给你一个正整数数组 nums，请你移除 最短 子数组（可以为 空），使得剩余元素的 和 能被 p 整除。 不允许 将整个数组都移除。
# 请你返回你需要移除的最短子数组的长度，如果无法满足题目要求，返回 -1 。
# 子数组 定义为原数组中连续的一组元素。
#
# 利用前缀和的特性快速计算任意子数组的和。然后根据变换可以知道对于nums[j]，只需要查找前面是不是有和presum[j]-target同余的前缀和。
class Solution:
    def minSubarray(self, nums: List[int], p: int) -> int:
        target = sum(nums) % p
        if target == 0:
            return 0
        n = len(nums)
        # need to find sum(nums[i:j]) % p == target
        # use presum, (presum[j]-presum[i-1])%p == target
        # then, presum[i-1]%p = (presum[j]-target)%p
        # then only need to check whether there is presum[i] before j of value (presum[j]-target)%p
        presum = 0
        res = n
        r2pos = dict({0: -1})
        for i, v in enumerate(nums):
            presum = (presum + nums[i]) % p
            expected = (presum - target) % p
            if expected in r2pos:
                res = min(res, i - r2pos[expected])
            r2pos[presum] = i

        return res if res < n else -1


